import React, { Component } from 'react';

class ContactDetails extends Component {
    state = {  }
    render() { 
        return ( 
            <div style={this.props.contact.isChoosen ? {display: "block"} : {display: ""}}>
                <div className="card text-center mb-4">
                    <div className="card-header">
                        {this.props.contact.name}
                    </div>
                    <div className="card-body">
                        <h5 className="card-title">Name: {this.props.contact.name}</h5>
                        <h5 className="card-title">Email: </h5>
                        <h5 className="card-title">Phone: </h5>
                        <h5 className="card-title">City: </h5>
                        <h5 className="card-title">State: </h5>
                        <h5 className="card-title">Country: </h5>
                        <h5 className="card-title">Organization: </h5>
                        <h5 className="card-title">Job Profile: </h5>
                        <h5 className="card-title">Additional Info: </h5>
                    </div>
                </div>
            </div>
         );
    }
}

export default ContactDetails;
